import React from 'react'
import LocationOnIcon from '@mui/icons-material/LocationOn';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { Button, CardActionArea, CardActions } from '@mui/material';
import RestaurantDetails from './RestaurantDetails';
import "../stylings/SearchBar.css"



function Restaurant({ results }) {
  return (
    <div className = "location_result">

      <Card sx={{ maxWidth: 345 }}>
          <CardActionArea>
            <CardMedia
              component="img"
              height="160"
              image={results.photograph}
              alt={results.name}
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                {results.name}
              </Typography>
              <Typography variant="ps" color="text.secondary">
               <LocationOnIcon/>{results.address} 
              </Typography>
            </CardContent>
          </CardActionArea>
          <CardActions>
            <Button size="small" color="primary">
              {/*<RestaurantDetails results={results}/>*/}
              Share
            </Button>
          </CardActions>
        </Card>  
    </div>
  )
}
export default Restaurant;
